import React, { Component } from "react";
import { Container, Image } from "semantic-ui-react";
import { withTranslation } from "react-i18next";
import { imageUrl, playStoreHref, AppleHref } from "./config";
import DesktopBreakpoint from "../../components/Responsive_utillities/desktop_breakPoint";
import PhoneBreakpoint from "../../components/Responsive_utillities/phone_breakPoint";

import "./LandingPageFooter.css";

class FooterDownloadLinks extends Component {
  render() {
    const language = localStorage.getItem("i18nextLng");
    const { t } = this.props;
    return (
      <Container fluid>
        <DesktopBreakpoint name="desktop">
          <h4 className={`footerdownloadLinksTitle ${language}`}>
            {t("landingPage:footerDownloadLinksTitle")}
          </h4>
          {language === "ar" ? (
            <div className={`footerdownloadLinks ${language}`}>
              <Image
                src={
                  language === "ar"
                    ? `${imageUrl}/landing-page/Google%20Play@3x-min.png`
                    : `${imageUrl}/landing-page/EnglishApp%20Store@3x-min.png`
                }
                href={language === "ar" ? `${playStoreHref}` : `${AppleHref}`}
                target="_blank"
                alt="googlePlay"
                className="footerdownloadLinksImages"
              />
              <Image
                src={
                  language === "ar"
                    ? `${imageUrl}/landing-page/App%20Store@3x-min.png`
                    : `${imageUrl}/landing-page/EnglishGoogle%20Play@3x-min.png`
                }
                href={language === "ar" ? `${AppleHref}` : `${playStoreHref}`}
                target="_blank"
                alt="appStore"
                className="footerdownloadLinksImages"
              />
            </div>
          ) : (
            <div className={`footerdownloadLinks ${language}`}>
              <Image
                src={
                  language === "ar"
                    ? `${imageUrl}/landing-page/App%20Store@3x-min.png`
                    : `${imageUrl}/landing-page/EnglishGoogle%20Play@3x-min.png`
                }
                target="_blank"
                alt="appStore"
                href={language === "ar" ? `${AppleHref}` : `${playStoreHref}`}
                className="footerdownloadLinksImages"
              />
              <Image
                src={
                  language === "ar"
                    ? `${imageUrl}/landing-page/Google%20Play@3x-min.png`
                    : `${imageUrl}/landing-page/EnglishApp%20Store@3x-min.png`
                }
                alt="googlePlay"
                target="_blank"
                href={language === "ar" ? `${playStoreHref}` : `${AppleHref}`}
                className="footerdownloadLinksImages"
              />
            </div>
          )}
        </DesktopBreakpoint>

        <PhoneBreakpoint name="phone">
          <h4 className={`footerdownloadLinksTitle ${language}`}>
            {t("landingPage:footerDownloadLinksTitle")}
          </h4>
          {language === "ar" ? (
            <div className={`footerdownloadLinks ${language}`}>
              <Image
                src={
                  language === "ar"
                    ? `${imageUrl}/landing-page/Google%20Play@3x-min.png`
                    : `${imageUrl}/landing-page/EnglishApp%20Store@3x-min.png`
                }
                href={language === "ar" ? `${playStoreHref}` : `${AppleHref}`}
                target="_blank"
                alt="googlePlay"
                className="footerdownloadLinksImages"
              />
              <Image
                src={
                  language === "ar"
                    ? `${imageUrl}/landing-page/App%20Store@3x-min.png`
                    : `${imageUrl}/landing-page/EnglishGoogle%20Play@3x-min.png`
                }
                target="_blank"
                alt="appStore"
                href={language === "ar" ? `${AppleHref}` : `${playStoreHref}`}
                className="footerdownloadLinksImages"
              />
            </div>
          ) : (
            <div className={`footerdownloadLinks ${language}`}>
              <Image
                src={
                  language === "ar"
                    ? `${imageUrl}/landing-page/App%20Store@3x-min.png`
                    : `${imageUrl}/landing-page/EnglishGoogle%20Play@3x-min.png`
                }
                target="_blank"
                alt="appStore"
                href={language === "ar" ? `${AppleHref}` : `${playStoreHref}`}
                className="footerdownloadLinksImages"
              />
              <Image
                src={
                  language === "ar"
                    ? `${imageUrl}/landing-page/Google%20Play@3x-min.png`
                    : `${imageUrl}/landing-page/EnglishApp%20Store@3x-min.png`
                }
                href={language === "ar" ? `${playStoreHref}` : `${AppleHref}`}
                target="_blank"
                alt="googlePlay"
                className="footerdownloadLinksImages"
              />
            </div>
          )}
        </PhoneBreakpoint>
      </Container>
    );
  }
}
export default withTranslation("landingPage")(FooterDownloadLinks);
